INSERT INTO `answers` (`id`, `answer_item_id`, `answer`, `post_id`, `user_id`, `company_id`, `category_id`, `post_flg`, `delete_flg`, `create_date`, `update_date`) VALUES
(1, 1, 'いろんなドラッグストアや薬局があるが、他よりも初年度から給与が高い傾向があります。\r\n年俸制でボーナスは月給に含まれており、月給としては多く感じます。\r\n稼ぎたい人は良いかと思います。', 7, 3, 1, 10, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(2, 2, '評価については数値目標や基準があり、それに沿って評価がされるような感じです。\r\n一部評価基準として適切だとは思えないものもありますが、全て納得するのは難しいと感じています。', 7, 3, 1, 10, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(3, 3, '勤務の時間帯はやはり遅めになります。\r\n時短やパートが日中に入るぶん、正社員は遅番になるので退勤が遅めになります。', 7, 3, 1, 3, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(4, 4, '大手で体制がある程度しっかりしている分、働きやすいです。\r\n休みも希望通り取れるかと思います。', 7, 3, 1, 3, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(5, 5, '各種手当や福利厚生も標準的だと思います。', 7, 3, 1, 2, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(6, 6, '立地は駅から遠い店舗もあり、駅から近い店舗もあります。', 7, 3, 1, 2, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(7, 7, '自分で考えた施策が当たり、店舗売り上げに貢献できた時', 7, 3, 1, 1, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(8, 8, '薬剤師としての調剤経験はもちろん、OTCにも関わることができます。', 7, 3, 1, 1, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(9, 9, NULL, 7, 3, 1, 5, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(10, 10, '人材は流動的ですが、ある程度確保されており、人材不足で本当に困ることはそんなにないです。\r\n異動は定期的にあります。', 7, 3, 1, 5, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(11, 11, '女性でも働きやすいと思います。', 7, 3, 1, 6, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(12, 16, '給与を他企業と比べたときに、高かったからです。', 7, 3, 1, 7, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(13, 17, NULL, 7, 3, 1, 8, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(14, 18, '調剤以外の売り上げがある点', 7, 3, 1, 9, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(15, 19, NULL, 7, 3, 1, 9, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(16, 20, '規模としては最大手であり、近いうちはこれが続くので安定性としてはあると思います。', 7, 3, 1, 9, 1, 0, '2021-04-30 21:59:05', '2021-04-30 12:59:05'),
(17, 1, '給与制度は年俸制で、社員区分や役職によってある程度年収が決まっています。\r\n他企業よりは給与水準が高い傾向にあるので、最初から稼ぎたい人は向いていると思います。', 8, 1, 1, 10, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(18, 2, '年次に伴って昇給はあります。個人の努力がボーナスに反映されるシステムも存在します。', 8, 1, 1, 10, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(19, 3, '残業時間は店舗によって異なります。首都圏の店舗は営業時間が遅めで終業時間が遅めになる傾向があります。', 8, 1, 1, 3, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(20, 4, 'マニュアル等がしっかりしており働きやすいです。', 8, 1, 1, 3, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(21, 5, '大手だけあって福利厚生は整っている方だと思います。各種手当も出ます。', 8, 1, 1, 2, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(22, 6, '調剤機器等は整っています。不自由、不便を感じたことはないです。', 8, 1, 1, 2, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(23, 7, '患者に信頼されて頼ってくれた時。', 8, 1, 1, 1, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(24, 8, '研修制度は充実しており、薬剤師としてレベルアップすることができます。', 8, 1, 1, 1, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(25, 9, NULL, 8, 1, 1, 5, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(26, 10, '店舗異動は定期的にあります。', 8, 1, 1, 5, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(27, 11, '産後も職場に戻っている人もおり、働きやすさは問題ないかと思います。', 8, 1, 1, 6, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(28, 16, '給与水準がある程度高かったので入社を決めました。\r\nマニュアル等がしっかりしており働きやすい印象です。', 8, 1, 1, 7, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(29, 17, '今のところ退職は検討していません。', 8, 1, 1, 8, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(30, 18, '多くの店舗を全国に展開しており、安定性がある点', 8, 1, 1, 9, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(31, 19, '規模拡大により体制が整っていない部分もある点。', 8, 1, 1, 9, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(32, 20, '今後地域を支える、面処方を受け付ける医療機関としての役割を担っていける可能性があります。', 8, 1, 1, 9, 1, 0, '2021-05-01 03:13:56', '2021-04-30 18:13:56'),
(33, 1, '給与制度は他社と同様な感じで、役職が上がらないとなかなか給料を上げられません。', 9, 2, 9, 10, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(34, 2, 'かかりつけの取得を求められます。目標以上に達成できていたとしてもボーナスに大きく反映されるわけではありません。年次が上がるにつれて昇給はありますが大きくはないです。', 9, 2, 9, 10, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(35, 3, '希望の休みは取得することができます。残業はそれなりにありますが、ワークライフバランスはそれほど悪くないです。', 9, 2, 9, 3, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(36, 4, '休みもしっかりあるので働き続ける点では問題ないです。', 9, 2, 9, 3, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(37, 5, '基本的な福利厚生はあります。全国転勤可能の区分なら住宅補助や引っ越し手当てなど、しっかり出るので問題ないです。', 9, 2, 9, 2, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(38, 6, '職場環境はある程度整っています。', 9, 2, 9, 2, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(39, 7, 'かかりつけの目標を達成できた時や患者さんから感謝された時です。', 9, 2, 9, 1, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(40, 8, '薬剤師として１人前になる環境はあります。', 9, 2, 9, 1, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(41, 9, 'ガッチリきっちりという感じです。', 9, 2, 9, 5, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(42, 10, '店舗の異動は定期的にあります。', 9, 2, 9, 5, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(43, 11, '女性の産後復帰支援もあり、問題はなさそうです。', 9, 2, 9, 6, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(44, 16, '予想通りといった感じで、大手の調剤薬局という感じです。', 9, 2, 9, 7, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(45, 17, NULL, 9, 2, 9, 8, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(46, 18, '規模が大きい分資本にゆとりがあるところです。', 9, 2, 9, 9, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(47, 19, '利益を大きく出せていない店舗がある点です。', 9, 2, 9, 9, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(48, 20, '調剤報酬での伸びが期待できないため、自社商品の開発、販売にも舵を切っていくと思われます。\r\n良くも悪くもないといったところです。', 9, 2, 9, 9, 1, 0, '2021-05-03 23:01:01', '2021-05-03 14:01:01'),
(49, 1, '時給も他薬局やドラッグストアよりも少し高めで満足しています。その代わり仕事量もしっかりこなさないといけないので少し大変なところもあります。\r\n残業手当も１分単位で出るので安心です。', 10, 4, 1, 10, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(50, 2, 'パートなので評価制度で大きく給与が上がることはありません。', 10, 4, 1, 10, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(51, 3, '希望通りの時間帯で働けて満足しています。休日も希望通り取れているので今のところは支障ないです。', 10, 4, 1, 3, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(52, 4, '最初の契約時の時間で働けており、かなり働きやすいです。', 10, 4, 1, 3, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(53, 5, '基本的な福利厚生はありますが、私の場合パートなのでそこまで恩恵はありません。', 10, 4, 1, 2, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(54, 6, '職場環境は整っていますよ。\r\n', 10, 4, 1, 2, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(55, 7, '患者にとってメリットのある介入ができた時です。\r\n相談に乗って解決できたときは、やはりやりがいを感じます。', 10, 4, 1, 1, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(56, 8, '調剤だけでなくOTCにも触れられるので経験の幅を広げられます。', 10, 4, 1, 1, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
(57, 9, 'マニュアル等が整っていて仕事がしやすいです。', 10, 4, 1, 5, 1, 0, '2021-05-04 15:09:22', '2021-05-04 06:09:22'),
