(115, 3, '残業時間は店舗によって異なります。首都圏の店舗は営業時間が遅めで終業時間が遅めになる傾向があります。\r\n休日は希望通り取れているのそれは良いです。', 24, 8, 1, 3, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(116, 4, '大手で体制がある程度しっかりしている分、働きやすいです。 ', 24, 8, 1, 3, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(117, 5, '大手だけあって福利厚生は整っている方だと思います。各種手当も出ます。\r\n\r\n', 24, 8, 1, 2, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(118, 6, '職場環境は標準的で整っているかと思います。', 24, 8, 1, 2, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(119, 7, '薬剤師としての知識を活かすことができ、患者さんの健康に貢献できた時です。', 24, 8, 1, 1, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(120, 8, '薬剤師としての調剤経験はもちろん、OTCにも関わることができます。\r\n\r\n', 24, 8, 1, 1, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(121, 9, '大手という感じでしっかりしている人が多い印象です。', 24, 8, 1, 5, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(122, 10, '人材は流動的ですが、ある程度確保されており、人材不足で本当に困ることはそんなにないです。 異動は定期的にあります。\r\n\r\n', 24, 8, 1, 5, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(123, 11, '女性も働きやすいです。', 24, 8, 1, 6, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(124, 16, '入社前の予想と入社後のギャップはそんなにないです。', 24, 8, 1, 7, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(125, 17, NULL, 24, 8, 1, 8, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(126, 18, '規模としては最大手であり、近いうちはこれが続くので安定性としてはあると思います。', 24, 8, 1, 9, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(127, 19, NULL, 24, 8, 1, 9, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(128, 20, '安定して働けるかとは思います。', 24, 8, 1, 9, 1, 0, '2021-06-19 22:26:39', '2021-06-19 13:26:39'),
(129, 1, 'いろんなドラッグストアや薬局があるが、他よりも初年度から給与が高い傾向があります。\r\n社員区分や役職によってある程度年収が決まっています。 ', 25, 9, 73, 10, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(130, 2, '年次に伴って昇給はありますが、やはり役職を上げないと年収を上げるには厳しいところもあります。', 25, 9, 73, 10, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(131, 3, '勤務の時間帯はやはり遅めになります。 時短やパートが日中に入るぶん、正社員は遅番になるので退勤が遅めになります。', 25, 9, 73, 3, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(132, 4, '大手で体制がある程度しっかりしている分、働きやすいです。 休みも希望通り取れるかと思います。', 25, 9, 73, 3, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(133, 5, '大手だけあって福利厚生は整っている方だと思います。各種手当も出ます。', 25, 9, 73, 2, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(134, 6, '立地が良い店舗が多い印象です。\r\n仕事に必要なものも整っており、仕事で困ることはないです。', 25, 9, 73, 2, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(135, 7, '自分で考えた施策が当たり、店舗売り上げに貢献できた時', 25, 9, 73, 1, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(136, 8, '調剤だけでなくOTCにも触れられるので経験の幅を広げられます。\r\n\r\n', 25, 9, 73, 1, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(137, 9, '大手で真面目な人が多い印象です。', 25, 9, 73, 5, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(138, 10, '人材は流動的ですが、ある程度確保されており、人材不足で本当に困ることはそんなにないです。 異動は定期的にあります。', 25, 9, 73, 5, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(139, 11, '女性でも働きやすいです。', 25, 9, 73, 6, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(140, 16, NULL, 25, 9, 73, 7, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(141, 17, NULL, 25, 9, 73, 8, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(142, 18, '多くの店舗を全国に展開しており、安定性がある点', 25, 9, 73, 9, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(143, 19, NULL, 25, 9, 73, 9, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(144, 20, '今後地域を支える、面処方を受け付ける医療機関としての役割を担っていける可能性があります。', 25, 9, 73, 9, 1, 0, '2021-06-19 22:33:35', '2021-06-19 13:33:35'),
(145, 1, '給与は業界標準的です。\r\n昇給も年次が上がるにつれて上がりますが、大きく上がっていくことはありません。\r\n手当やボーナスも標準的です。', 27, 5, 9, 10, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(146, 2, '評価は様々な項目があり、ある程度正当に評価されていると思います。\r\nボーナスへの反映も多少はあります。', 27, 5, 9, 10, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(147, 3, '希望の休みは通るのでその辺りは問題ないです。\r\n年間の休日日数も少ないわけではないので、ワークライフバランスも保てられています。', 27, 5, 9, 3, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(148, 4, NULL, 27, 5, 9, 3, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(149, 5, '福利厚生も整っています。', 27, 5, 9, 2, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(150, 6, '職場の立地は店舗それぞれですが、立地が良い店舗が多い気がします。\r\n通勤も困ることはないです。', 27, 5, 9, 2, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(151, 7, '薬の相談で患者さんから感謝された時です。', 27, 5, 9, 1, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(152, 8, '基本的な研修もあって学んでから職場に出ることができました。', 27, 5, 9, 1, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(153, 9, '企業文化はがっちりしている感じです。', 27, 5, 9, 5, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(154, 10, '組織体制や人材は整っていると思います。\r\n私は契約なので店舗異動はないです。', 27, 5, 9, 5, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(155, 11, '産休、産後復帰も可能なので女性の働きやすさは良いかと思います。', 27, 5, 9, 6, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(156, 16, '入社後の印象は、入社前の予想通りで、特にギャップもありませんでした。', 27, 5, 9, 7, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(157, 17, NULL, 27, 5, 9, 8, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(158, 18, '全国に店舗があるため、全国どこでも勤務しようと思えば勤務できるかと思います。', 27, 5, 9, 9, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(159, 19, '調剤報酬に頼っているところがあるため、国の方針で売り上げが上下するリスクがある。', 27, 5, 9, 9, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(160, 20, '今後は調剤一本では難しいところもあると思います。', 27, 5, 9, 9, 1, 0, '2021-06-19 22:52:15', '2021-06-19 13:52:15'),
(161, 1, 'ドラッグストアの中では並程度の給与で、病院や薬局より給与が高い傾向があります。稼ぎたい人は良いかと思います。', 28, 10, 4, 10, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(162, 2, '年次に伴って昇給はありますが、やはり役職を上げないと年収を上げるには厳しいところがあります。', 28, 10, 4, 10, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(163, 3, '勤務時間は長めですが、その分休みもありバランスが取れているかと思います。', 28, 10, 4, 3, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(164, 4, '体制がある程度しっかりしている分、働きやすいです。 休みも希望通り取れるかと思います。', 28, 10, 4, 3, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(165, 5, '福利厚生は整っている方だと思います。各種手当も出ます。', 28, 10, 4, 2, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(166, 6, '職場環境は標準的で整っているかと思います。立地は店舗によって様々です。', 28, 10, 4, 2, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(167, 7, '健康相談でお客さんの悩みを解決できたときです。', 28, 10, 4, 1, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(168, 8, '薬剤師としての調剤経験はもちろん、OTCにも関わることができるので知識の幅も広がります。', 28, 10, 4, 1, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(169, 9, 'いい意味でも悪い意味でもいろんな人がいます。\r\n合う合わないは人によるので何とも言えません。', 28, 10, 4, 5, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(170, 10, '人材不足感があり、現場が苦しむこともありますが業界的にそういうところもあるので一概には断定できません。', 28, 10, 4, 5, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(171, 11, '家庭を両立しながら働けている女性もいらっしゃいます。', 28, 10, 4, 6, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(172, 16, '予想よりもハードワークです。', 28, 10, 4, 7, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(173, 17, NULL, 28, 10, 4, 8, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(174, 18, '多くの店舗を全国に展開しており、安定性がある点、調剤以外でも収益がある点です。', 28, 10, 4, 9, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(175, 19, NULL, 28, 10, 4, 9, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24'),
(176, 20, '今後地域を支える、面処方を受け付ける医療機関としての役割を担っていける可能性もあります。', 28, 10, 4, 9, 1, 0, '2021-06-19 22:55:24', '2021-06-19 13:55:24');
