INSERT INTO `questions` (`id`, `question`, `category_id`, `rating_item_id`, `answer_item_id`, `delete_flg`, `create_date`, `update_date`) VALUES
(1, 'この会社に在籍しているときの、生活の総合的な幸福度を教えてください。幸福度は満足できるものでしたか？', NULL, 1, NULL, 0, '2021-04-20 15:21:43', '2021-04-20 06:23:52'),
(2, 'この会社の業績は今後向上していくと思いますか？', NULL, 2, NULL, 0, '2021-04-20 15:54:42', '2021-04-20 07:02:06'),
(3, 'この会社の事業は競合他社よりも優位性・独自性があると思いますか？', NULL, 3, NULL, 0, '2021-04-20 15:54:42', '2021-04-20 07:02:06'),
(4, 'この会社の評価制度では、個人の努力が正当に評価されていると思いますか？', NULL, 4, NULL, 0, '2021-04-20 15:54:42', '2021-04-20 07:02:06'),
(5, 'この会社は20代社員に裁量や責任を持たせるなど、若手社員が成長する機会があると思いますか？', NULL, 5, NULL, 0, '2021-04-20 15:54:42', '2021-04-20 07:02:06'),
(6, 'この会社は新規事業への投資やテクノロジーの導入など、新たな挑戦に積極的だと思いますか？', NULL, 6, NULL, 0, '2021-04-20 16:12:22', '2021-04-20 07:16:52'),
(7, 'この会社の経営陣に会社の将来を任せても大丈夫だと思いますか？', NULL, 7, NULL, 0, '2021-04-20 16:27:58', '2021-04-20 07:29:45'),
(8, 'この会社では気兼ねなく相談や提案ができる人間関係でしたか？', NULL, 8, NULL, 0, '2021-04-20 16:27:58', '2021-04-20 07:29:45'),
(9, 'この会社での勤務時間は、入社時の説明通りで納得していますか？', NULL, 9, NULL, 0, '2021-04-20 16:27:58', '2021-04-20 07:29:45'),
(10, 'この会社での休日・休暇は、入社時の説明通りで満足していますか？', NULL, 10, NULL, 0, '2021-04-20 16:27:58', '2021-04-20 07:29:45'),
(11, 'この会社での年収・給与は、仕事量・質に対して満足できるものですか？', NULL, 11, NULL, 0, '2021-04-20 16:29:52', '2021-04-20 07:34:47'),
(12, 'この会社で働いて、あなたのキャリアにとってプラスになっていると思いますか？', NULL, 12, NULL, 0, '2021-04-20 16:29:52', '2021-04-20 07:34:47'),
(13, 'この会社の給与制度（昇給、手当て、ボーナス、残業代等）について、特徴を教えてください。', 10, NULL, 1, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(14, 'この会社の評価制度（昇給・昇格の基準、評価のされ方、ボーナスへの反映）にはどのような特徴がありますか？', 10, NULL, 2, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(15, 'この会社でのワークライフバランスはいかがですか？勤務・残業時間（1日あたり、1ヶ月あたり）、休暇（年間休日日数や休みの取り方）について、どのような特徴がありますか？', 3, NULL, 3, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(16, 'この会社での働きやすさはいかがですか？勤務時間の柔軟性など、働き方支援について教えてください。', 3, NULL, 4, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(17, 'この会社の福利厚生（住宅補助、退職金、引越し時の手当てなど）にはどのような特徴がありますか？', 2, NULL, 5, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(18, 'この会社の職場環境（立地、仕事で必要な機材の充実度、環境整備）はいかがですか？', 2, NULL, 6, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(19, 'この会社での仕事のやりがいは、どのようなとき、どのような点に感じますか？', 1, NULL, 7, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(20, 'この会社での勤務経験を通じて、キャリアにおいてどのような成長ができますか？どのような支援制度・研修がありましたか？', 1, NULL, 8, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(21, 'この会社の企業文化（重視している理念や方向性）や雰囲気はいかがですか？', 5, NULL, 9, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(22, 'この会社の組織体制にはどのような特徴がありますか？また、店舗や部署の異動頻度はいかがですか？', 5, NULL, 10, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(23, 'この会社での女性の働きやすさはいかがですか？制度や支援はどのようなものがありますか？', 6, NULL, 11, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(24, '入社理由、入社する前と入社した後の印象の変化・ギャップについて教えてください。', 7, NULL, 16, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(25, '退職を検討した理由について教えてください。', 8, NULL, 17, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(26, 'この会社が同業他社よりも強みがあるのはどのような点だと思いますか？', 9, NULL, 18, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(27, 'この会社が同業他社よりも弱みがあるのはどのような点だと思いますか？', 9, NULL, 19, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24'),
(28, 'この会社の将来性はいかがですか？今後の見通しについて教えてください。', 9, NULL, 20, 0, '2021-04-30 12:29:52', '2021-04-30 04:38:24');
